import React, { useRef } from 'react';

export default function ToolBar(content) {
    const log = () => {
      if (content) {
        console.log(content.content);
      }
    };

    return (
        <div className='toolBar'>
            <button onClick={log}>Save</button>
        </div>
    );
}
